import React from 'react'
//import navbarcss from './css/Navbar.css'
function Navbar() {
  return (
    <nav>
    <img id="logo" src="http://pvppcoe.ac.in/assets/img/VISUAL%20ART%20LOGO%201.png" alt="VPPCOE logo"></img>
    <h1 id="name">Vasantdada Patil Pratishthan's College of Engineering & Visual Arts</h1>
    </nav>
  );
}

export default Navbar
